**Description**: 
1. add pytorch_half_pixel interpolation mode in resize-packed.ts
Changes: add the following case in createPackedResizeProgramInfo function:
```
case 'pytorch_half_pixel':
          getSourceFracIndex = `
                    vec4 getSourceFracIndex(ivec4 coords) {
                        vec4 fcoords = vec4(coords);
                        return vec4(
                            ${outputWidth}.0 > 1.0 ? (fcoords.x + 0.5) / scaleWHWH.x - 0.5 : 0.0,
                            ${outputHeight}.0 > 1.0 ? (fcoords.y + 0.5) / scaleWHWH.y - 0.5 : 0.0,
                            ${outputWidth}.0 > 1.0 ? (fcoords.z + 0.5) / scaleWHWH.z - 0.5 : 0.0,
                            ${outputHeight}.0 > 1.0 ? (fcoords.w + 0.5) / scaleWHWH.w - 0.5 : 0.0
                          );
                    }
                `;
          break;
```
2. fix "unrecognized input '' for node: Resize_$num" error when inputs like [input_tensor, None, scale_factor] (roiInput not given) are fed into the resize layer.
Changes: change in input handling logic in upsample.ts & node scanning logic in graph.ts

**Motivation and Context**
Before this fix, we aren't able to use webGL backend when the neural network contains pytorch resize layers. This fix adds 'pytorch_half_pixel' interpolation mode support and makes it possible to use webGL backend for more kind of computer vision networks.

This commit solves:
#10430

**Describe the bug**
We have traced an image classification model that uses an if node triggered by a boolean input to dynamically enable / disable certain a particular subgraph at inference time. The subgraph holds our preprocessing stages so it is at the beginning of the onnx graph.

We are trying to leverage the CUDA EP for lower latency, and in production we will have already loaded the input image into device memory. During our profiling, however, we found that the image is being copied from the device to host memory at input binding time, and then immediately copied *back* into the device when Run() is called. These extra copies are completely redundant and, for larger images, have a huge impact on our e2e pipeline latency. (See screenshots)

Based on our experiments it seems that the specific cause is the use of an if node at the beginning of the graph which consumes the image as an input. We've included a minimal example onnx file as well as python code to generate it below.

**Urgency**
This is a severe blocking issue for some of our deliverables in the 8 - 10 week range.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Ubuntu 18.04
- ONNX Runtime installed from (source or binary): gpu binary from release
- ONNX Runtime version: 1.10-gpu
- Python version: N/A
- Visual Studio version (if applicable): N/A
- GCC/Compiler version (if compiling from source): N/A
- CUDA/cuDNN version: CUDA 11.4, cuDNN 8.2.4
- GPU model and memory: V100, 16GB

**To Reproduce**
See working code below for our setup for running inference against the provided onnx model.

See the screenshot provided for the corresponding nsys trace. You will see three memory transitions happen during the following code, as labeled in the screenshot:
1. Host-to-device: this is done in a non-ORT stream when we run `cudaMemcpy` below
2. Device-to-host: this happens at IO binding time, the model seems to want the image loaded into *host* memory even though there is no cpu work that requires the image
3. Host-to-device: happens at the Run() call, the binding copied the image to host but then the model immediately requests that it be moved back to the device

Note that we did some quick experiments inserting sleep delays to confirm where in the code flow these memory transfers happen.

```cpp
// set up sessionoptions for cuda
Ort::Env env(OrtLoggingLevel::ORT_LOGGING_LEVEL_ERROR, "eval");
OrtCUDAProviderOptions cudaOptions;
cudaOptions.gpu_mem_limit = 6L * (1024L * 1024L * 1024L);
Ort::SessionOptions sessionOptions;
sessionOptions.SetIntraOpNumThreads(6);
sessionOptions.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);
sessionOptions.AppendExecutionProvider_CUDA(cudaOptions);

// build model from provided sample onnx
Ort::Session icModel(env, "ifelse.onnx", sessionOptions);

// build cpu / gpu allocators
Ort::AllocatorWithDefaultOptions cpuAllocator;
Ort::MemoryInfo cpuMemoryInfo =
    Ort::MemoryInfo::CreateCpu(OrtAllocatorType::OrtArenaAllocator, OrtMemType::OrtMemTypeDefault);
Ort::MemoryInfo gpuMemoryInfo = Ort::MemoryInfo("Cuda", OrtAllocatorType::OrtDeviceAllocator, 0, OrtMemTypeDefault);

// build rectangular image with random float values using OpenCV
const size_t ImgDim = 1000;
cv::Mat img(ImgDim, ImgDim, CV_32FC3);
cv::randu(img, cv::Scalar(0), cv::Scalar(255));

// set up input metadata
std::vector<int64_t> imageInputDims{1, 3, imgDim, imgDim};
static const bool FalseValue = false;
std::vector<int64_t> controlInputDims{1};

// copy image to device memory
Ort::Allocator cudaAllocator(modelSession, gpuMemoryInfo);
size_t imageBufferSize = 3 * static_cast<size_t>(imgDim) * static_cast<size_t>(imgDim) * sizeof(float);
void* inputBuffer = cudaAllocator.Alloc(imageBufferSize);
cudaMemcpy(inputBuffer, batch.ptr<float>(), imageBufferSize, cudaMemcpyHostToDevice);

std::vector<Ort::Value> inputTensors;

// create input tensor with image in gpu memory
inputTensors.emplace_back(Ort::Value::CreateTensor<float>(
    gpuMemoryInfo,
    reinterpret_cast<float*>(inputBuffer),
    3 * static_cast<size_t>(imgDim) * static_cast<size_t>(imgDim),
    imageInputDims.data(),
    imageInputDims.size()));

// add if / else control input tensor from cpu memory
inputTensors.emplace_back(
    Ort::Value::CreateTensor<bool>(cpuMemoryInfo,
                                    const_cast<bool*>(&FalseValue),
                                    1,
                                    controlInputDims.data(),
                                    controlInputDims.size()));

// bind I/O and sync inputs
Ort::IoBinding binding(modelSession);
binding.BindInput("image", inputTensors[0]);
binding.BindInput("control", inputTensors[1]);
binding.BindOutput("output", gpuMemoryInfo);
binding.SynchronizeInputs();

// run inference
modelSession.Run(Ort::RunOptions{nullptr}, binding);
```

