import torch.nn as nn
import torch
import onnxruntime as ort
import numpy as np

class IfElseModule(nn.Module):
    def forward(self, image, control):
        if not control:
            return image

        return torch.add(image, 10)

ifelse_module = torch.jit.script(IfElseModule())
trace_image = torch.rand((1, 224, 224, 3), dtype=torch.float32)
trace_control = torch.tensor([True])
onnx_filename = "ifelse.onnx"

torch.onnx.export(ifelse_module, (trace_image, trace_control), 
    onnx_filename, input_names=["image", "control"], output_names=["output"], dynamic_axes={"image": [1, 2, 3]}, opset_version=11)

session = ort.InferenceSession(onnx_filename)
print(session.run(["output"], {"image": np.random.default_rng().standard_normal((1, 224, 224, 3), dtype=np.float32), "control": np.array([True])}))
```

